import React from 'react';
import '../stylesheets/Work.css';

class Work  extends React.Component {
  render() {
    return (
      <div className="work">
        <ul className="project_container">
          <li className="project project1">
            <div className="img_container"><img src="./images/module-1.png" alt="project-module-1" width="400px"></img></div>
          </li>
          <li className="project exam">
            <div className="img_container"><img src="./images/modulo-1.png" alt="pokedex" width="400px"></img></div>
          </li>
          <li className="project project2">
            <div className="img_container"><img src="./images/project-module-2.jpg" alt="project-module-2" width="400px"></img></div>
          </li>
          <li className="project exam">
            <div className="img_container"><img src="./images/pokedex.png" alt="pokedex" width="400px"></img></div>
          </li>
        </ul>
      </div>
    );
  }
}

export default Work;
